import React from "react";

export const FlowerIntro = () => {
  return (
    <>
      <section className="intro">
        <h2>
          Choose the bouquet what will be answering on your taste and specified
          situation
        </h2>
        <div>
          Birthday, Anniversary, or simple gift - we can do everything possible
          and impossible to create with help of only flowers
        </div>
      </section>
    </>
  );
};
